import axios from "axios";
import { IMovie } from "../interfaces/movieInterface";

const BASE_URL_API = "http://localhost:8080";
export const ALL_MOVIES = "/api/movie/getall";
export const MATCHING_MOVIES = "/api/movie/matchingmovies";

export const get = async (
  endpoint: string,
  paramKey?: string,
  paramValue?: string
) => {
  const params = paramKey ? { paramKey: paramValue } : "";
  try {
    const response = await axios.get<IMovie[]>(BASE_URL_API + endpoint, {
      params: { params },
      headers: {
        "Content-Type": "application/json",
        Accept: "application/json",
      },
    });
    return response.data;
  } catch (err) {
    console.log(err);
  }
};
